import PropTypes from "prop-types";

// so here is a parent component and here is with the children will pass, so when I use the <Page> tag in other documment like the index, there I typed some stuff and if i want it to pass here temporary(no won't pass in e)
export default function Page({ children, cool }) {
  return (
    <div>
      <h1>
        I am the page component! children because Im smaller and i belong
        somewhere:$
      </h1>
      <h3>
        Lina we pass first because im the father and this are my children::::
        {cool}
      </h3>
      {children}
    </div>
  );
}

Page.propTypes = {
  cool: PropTypes.string,
  children: PropTypes.any,
};
